const CubeSide1 = ({ xVal, yVal, zVal }) => {
  return (
    <div
      style={{ transform: `rotate3d(200, 1, 1, ${xVal}deg)` }}
      className='side1'
    ></div>
  );
};

export default CubeSide1;
